(1, 9, 101, '102102101', 'LE PLIAGE NÉO TOP HANDLE BAG W/LONG STRAP', NULL, '42022100', 33, 'LONGCHAMP', 37, 'Le Pliage Néo', 101, 'LOLN101', NULL, NULL, 1, '/media/images/products/1/prod_08112020_5fa85543b7213.png', 'PRODUCT DETAILS & CARE\r\nReference : L1515598001\r\nDimensions : 28 x 32 x 17 cm / 11 x 12.6 x 6.7 in\r\nMaterial : Polyamide canvas with inside coating\r\nTrimming : Cowhide\r\nLining : Polyamide - Jacquard, Longchamp history (for all models except for Le Pliage shapes, Le Pliage shapes no lining)\r\nAccessories finishing : Nickel\r\nWeight : 350 g\r\nEXTERIOR DETAILS\r\nClosing : Zipped and snap closure', 3, 20, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL, NULL, 1, '2020-11-08 20:29:55', 1, '2020-11-09 09:29:26', NULL),
(3, 1, 111, '101101111', 'LC Cast Iron Balti Dish', NULL, '73239200', 1, 'Le Creuset', 38, 'Balti Dish', 101, 'LCBD101', NULL, NULL, 1, '/media/images/products/3/prod_10112020_5fa9d86630453.jpg', 'LC Cast Iron Balti Dish\r\n\r\nCapacity: 2.7 L\r\nLength: 31 cm\r\nWidth: 25 cm\r\nHeight: 11 cm\r\nDepth: 7.5 cm\r\n\r\nHeat Source:\r\nOven, Grill, Electric Hob, Ceramic Glass Cooktop, Gas Hob & Induction Hob\r\n\r\nFeatures\r\n\r\nQuick clean-up: \r\nan enamel interior helps make light work of cleaning.\r\n\r\nA real workhorse: \r\nfit for the oven, hob, induction or under the grill.\r\n\r\nGreat tasting food: \r\nthe cast iron construction retains heat for even cooking and browning. Your delicious creations will also stay warmer at the table for longer.\r\n\r\nEasy-grip: \r\nits stylish and comfortable handles allow for safe lifting.\r\n\r\nNot too hot: \r\ncook with a steady, low to medium heat to take care of your cast iron and enjoy delicious results.\r\n\r\nAges gracefully: \r\nthe enamel interior develops a natural patina that will behave like a non-stick surface. Its finish also has great food release properties with less seasoning required. Clean the product only with water so that the patina can be developed.', 3, 20, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL, NULL, 1, '2020-11-08 23:36:23', 1, '2020-11-10 00:01:42', NULL),
(4, 1, 114, '101101114', 'LC Signature Round Skillet', NULL, '73239200', 1, 'Le Creuset', 4, 'Signature Skillet', 101, 'LCSK101', NULL, NULL, 1, '/media/images/products/4/prod_10112020_5faab5ef45c62.jpg', 'Signature Round Skillet', 3, 20, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL, NULL, 1, '2020-11-09 00:18:49', 1, '2020-11-10 23:20:16', NULL),
(6, 1, 103, '101101103', 'VonShef Cast Iron Skillet Pan', NULL, '73239100', 62, 'VonShef', 41, 'Skillet', 101, 'VSSK101', NULL, NULL, 1, '/media/images/products/6/prod_09112020_5fa91e7cf2433.jpg', 'About this item\r\n6”, 8” & 10” SKILLET PANS – introduce this set of three skillet pans to your kitchen and start grilling, frying, searing and baking all kinds of delicious meals to perfection\r\nNATURALLY NON-STICK – pre-seasoned cooking surface of pans allows for little-to-no-oil cooking and makes cleaning up easy\r\nCAST IRON – ultra-durable and heats evenly to a high temperature for a perfectly balanced result\r\nVERSATILE – oven safe and suitable for any hob type, perfect for cooking food on the hob then finishing under the grill\r\nPOURING LIPS – situated on either side of each pan to make pouring out excess fat easy. Hand wash only.', 3, 20, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL, NULL, 1, '2020-11-09 10:48:28', 1, '2020-11-09 10:48:29', NULL),
