d comfortable handles allow for safe lifting.\r\n\r\nNot too hot: \r\ncook with a steady, low to medium heat to take care of your cast iron and enjoy delicious results.\r\n\r\nAges gracefully: \r\nthe enamel interior develops a natural patina that will behave like a non-stick surface. Its finish also has great food release properties with less seasoning required. Clean t', 'serach generated', 1, NULL, NULL, NULL, NULL, 1, '2020-11-08 23:43:39', 1, '2020-12-23 03:46:05', NULL),
(10, 6, 101, '101101103101', 'VonShef Cast Iron Skillet Pan Set 3 Piece - Pre-Seasoned - Black - 6\"-8\"-10\"', NULL, 22, '6\"-8\"-10\"', 43, 'Black', 101, 'VSSK101101', '73239100', 'need to add', 1, 'About this item\r\n6”, 8” & 10” SKILLET PANS – introduce this set of three skillet pans to your kitchen and start grilling, frying, searing and baking all kinds of delicious meals to perfection\r\nNATURALLY NON-STICK – pre-seasoned cooking surface of pans allows for little-to-no-oil cooking and makes cleaning up easy\r\nCAST IRON – ultra-durable and heats evenly to a high temperature for a perfectly balanced result\r\nVERSATILE – oven safe and suitable for any hob type, perfect for cooking food on the hob then finishing under the grill\r\nPOURING LIPS – situated on either side of each pan to make pouring out excess fat easy. Hand wash only.', NULL, NULL, 299, 349, 0, 339, 'SEA', 0, 50, 3, 20, NULL, 'VonShef Cast Iron Skillet Pan Set 3 Piece - Pre-Seasoned - Black - 6\"-8\"-10\"  6\"-8\"-10\" Black VSSK101101 SEA About this item\r\n6”, 8” & 10” SKILLET PANS – introduce this set of three skillet pans to your kitchen and start grilling, frying, searing and baking all kinds of delicious meals to perfection\r\nNATURALLY NON-STICK – pre-seasoned cooking surface of pans allows for little-to-no-oil cooking and makes cleaning up easy\r\nCAST IRON – ultra-durable and heats evenly to a high temperature for a perfectly balanced result\r\nVERSATILE – oven safe and suitable for any hob type, perfect for cooking food on the hob then finishing under the grill\r\nPOURING LIPS – situated on either side of each pan to make pouring out excess fat easy. Hand wash only.', 'serach generated', 1, NULL, NULL, NULL, NULL, 1, '2020-11-09 10:49:51', 1, '2020-11-09 10:51:27', NULL),
