(301, 148, 101, '101105107101', 'Dolce Gusto De\'Longhi Piccolo XS - Red - One Size', 'Dolce Gusto De\'Longhi  Piccolo XS Pod Coffee Machine- Red', 30, 'One Size', 50, 'Red', 101, 'DLPX101101', '85167100', '8004399334069', 1, '<p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 20px; line-height: 1.5rem; font-family: Barlow, \"Helvetica Neue\", Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(38, 38, 38); letter-spacing: normal;\">The extra-small NESCAFE Dolce Gusto Piccolo XS by De\'Longhi. Just slide in a coffee pod and with the push of a button you can prepare your perfect beverage of choice. From frothy Latte Macchiatos, delicious Cappuccinos to smooth Americanos. All the coffee grinds stay in the coffee pods so there is virtually no cleaning either. A convenient eco-mode feature automatically turns off the NESCAFE Dolce Gusto Piccolo XS after 5 minutes of inactivity, giving this machine an A rating in energy consumption.</p><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 20px; line-height: 1.5rem; font-family: Barlow, \"Helvetica Neue\", Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(38, 38, 38); letter-spacing: normal;\">Whilst mini in size, it\'s maximum 15-bar pump pressure makes it powerful enough to create the perfect coffee shop style drink every time.</p><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 20px; line-height: 1.5rem; font-family: Barlow, \"Helvetica Neue\", Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(38, 38, 38); letter-spacing: normal;\">Versatile machin