(303, 150, 101, '101103112101', 'MORPHY RICHARDS ACCENTS 4 PCS GADGET SET - BLACK', 'Morphy Richards Kitchen Utensils Set, Accents Range, Kitchen Gadget Set, Stainless Steel, Black, 4-Piece', 97, '4 PIECES', 128, 'BLACK', 101, 'MRSE103101', '73231000', '5011832038098', 1, '<h3 style=\"padding: 0px 0px 4px; margin: 0.75em 0px 0.375em -1px; text-rendering: optimizelegibility; font-size: 1.23em; line-height: 24px; color: rgb(51, 51, 51); clear: left; font-family: \"Amazon Ember\", Arial, sans-serif;\">Product Description</h3><p style=\"padding: 0px; margin: 0em 0px 1em 1em; color: rgb(51, 51, 51); font-family: \"Amazon Ember\", Arial, sans-serif; font-size: small; letter-spacing: normal;\">Equip your kitchen with all the essential cooking utensils with this elegant and practical 4-piece set. The utensil set is comprised of a can opener, grater, Y turner and pizza wheel, each ergonomically designed to provide high quality comfort and control when in use. Its stainless steel structure adds an extra level of durability so you can use them for years to come. The accompanying wire utensil holder provides convenient storage so your countertops remain neat and tidy. It\'s a practical and well-rounded addition to your kitchen. This gadget set is part of the Morphy Accents range, which features a collection of essential kitchen appliances with a sleek design in six different colour options.</p><h3 style=\"padding: 0px 0px 4px; margin: 0.75em 0px 0.375em -1px; text-rendering: optimizelegibility; font-size: 1.23em; line-height: 24px; color: rgb(51, 51, 51); clear: left; font-family: \"Amazon Ember\", Arial, sans-serif;\">Box Contains</h3><p style=\"padding: 0px; margin: 0em 0px 1em 1em; color: rgb(51, 51, 51); font-family: \"Amazon Ember\", Arial, sans-serif; font-size: small; letter-spacing: normal;\"></p><ul style=\"margin: 1.12em 0px 1.12em 20px; padding: 0px; font-family: \"Amazon Ember\", Arial, sans-serif; font-size: small;\"><li style=\"list-style-type: disc; overflow-wrap