(316, 158, 101, '101106104101', 'BISSELL CROSSWAVE  3-in-1 Multi-Surface Floor Cleaner | Vacuums, Washes & Dries 1713 - BLUE MULTI', 'BISSELL CrossWave | 3-in-1 Multi-Surface Floor Cleaner | Vacuums, Washes & Dries | Cleans Hard Floors & Area Rugs | 1713', 47, 'ONE SIZE', 133, 'BLUE MULTI', 101, 'BIVW101101', '85086000', '011120229547', 1, '<h3 style=\"text-align: justify; padding: 0px 0px 4px; margin: 0.75em 0px 0.375em -1px; text-rendering: optimizelegibility; font-size: 1.23em; line-height: 24px; color: rgb(51, 51, 51); clear: left; font-family: &quot;Amazon Ember&quot;, Arial, sans-serif;\">Product Description</h3><p style=\"text-align: justify; padding: 0px; margin: 0em 0px 1em 1em; color: rgb(51, 51, 51); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: small; letter-spacing: normal;\">BISSELL CrossWave is the 3-in-1 multi-surface floor cleaner made for our busy lives. CrossWave simultaneously vacuums, washes and helps to dry floors in one easy step, from hardfloors, to tiles, to rugs! CrossWave does all the three steps at the same time and is suitable for all hardfloors and area rugs in your home. It enables you to clean multiple floor types in one action. The unique brush roll scrubs and washes floors for a deeper clean, and it does not release dirty water back on to the floor. Digital touch controls for an intuitive and convenient control of cleaning. Low profile foot and pivoting floor head for easy maneuverability. Easy to remove dual tank technology - separate clean and dirty tanks eliminates the need to empty the water tank and ensures you always wash your floors with clean water. Due to the separate tanks, the device is always cleaning with a mix of clean water and formula. For best performance, please use BISSELL multi-surface, multi surface pet or wood floor cleaning detergent. Please note, the BISSELL Product Guarantee for this product is only valid when used in the United Kingdom.</p><h3 style=\"text-align: justify; padding: 0px