(415, 206, 101, '101105111101', 'CUISINART CHOPPER AND FOOD PROCESSOR 900 ML - STAINLESS STEEL - MINI', 'Cuisinart Mini Prep Pro Mini Chopper And Food Processor | 900ml Capacity | Stainless Steel', 134, 'MINI', 193, 'STAINLESS STEEL', 101, 'CUFR101101', '85094000', '3030059900041', 1, '<p>CHOPPER AND FOOD PROCESSOR</p><h1 id=\"title\" class=\"a-size-large a-spacing-none\" style=\"padding: 0px; margin-right: 0px; margin-left: 0px; text-rendering: optimizelegibility; color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; margin-bottom: 0px !important; font-size: 24px !important; line-height: 32px !important;\"><span id=\"productTitle\" class=\"a-size-large product-title-word-break\" style=\"text-rendering: optimizelegibility; word-break: break-word; font-size: 19px !important; line-height: 32px !important;\">Cuisinart Mini Prep Pro Mini Chopper And Food Processor | 900ml Capacity</span></h1><h1 id=\"title\" class=\"a-size-large a-spacing-none\" style=\"padding: 0px; margin-right: 0px; margin-left: 0px; text-rendering: optimizelegibility; color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; margin-bottom: 0px !important; font-size: 24px !important; line-height: 32px !important;\"><span id=\"productTitle\" class=\"a-size-large product-title-word-break\" style=\"text-rendering: optimizelegibility; word-break: break-word; font-size: 19px !important; line-height: 32px !important;\"><ul class=\"a-unordered-list a-vertical a-spacing-mini\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 18px; color: rgb(17, 17, 17); padding: 0px; font-size: 14px;\"><li style=\"list-style-type: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">Every chef needs a helping hand, make yours this mini food chopper with a two way motor and blades that can chop, mince, puree, emulsify, grind, crush and more!</span></li><li style=\"list-style-type: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">The 900ml bowl is perfectly sized for everyday use - chop an onion in seconds, puree baby food, create delicious dips and dressings, wholesome hummus or grind nuts, seeds or chocolate</span></li><li style=\"list-style-type: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">Blade Lock feature holds the blades in place even when you tip the bowl upside down to scoop or pour your ingredients safely</span></li><li style=\"list-style-type: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">With pulse buttons for chopping or grinding and drizzle holes in the lid this mini food processor really is the a must-have for your culinary creations</span></li><li style=\"list-style-type: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">Includes: 900ml bowl, lid with drizzle holes, chopping/grinding blade, spatula</span></li><li style=\"list-style-type: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">Dishwasher safe bowl, lid, blades and spatula</span></li></ul></span></h1>', 660, '/media/images/products/206/prod_20122020_5fde860d09b43.jpg', 359, 399, 0, 339, 'SEA', 0, 35, 3, 20, NULL, 'CUISINART CHOPPER AND FOOD PROCESSOR 900 ML - STAINLESS STEEL - MINI Cuisinart Mini Prep Pro Mini Chopper And Food Processor | 900ml Capacity | Stainless Steel MINI STAINLESS STEEL CUFR101101 SEA  CHOPPER AND FOOD PROCESSOR   Cuisinart Mini Prep Pro Mini Chopper And Food Processor | 900ml Capacity       Every chef needs a helping hand, make yours this mini food chopper with a two way motor and blades that can chop, mince, puree, emulsify, grind, crush and more!    The 900ml bowl is perfectly sized for everyday use - chop an onion in seconds, puree baby food, create delicious dips and dressings, wholesome hummus or grind nuts, seeds or chocolate    Blade Lock feature holds the blades in place even when you tip the bowl upside down to scoop or pour your ingredients safely    With pulse buttons for chopping or grinding and drizzle holes in the lid this mini food processor really is the a must-have for your culinary creations    Includes: 900ml bowl, lid with drizzle holes, chopping/grindi', NULL, 1, NULL, NULL, NULL, NULL, 1, '2020-12-20 05:00:29', 1, '2020-12-20 05:35:03', NULL),
(416, 149, 102, '101103111102', 'ACCENTS 5 PCS TOOL SET - RED - 5 PIECES', 'Morphy Richards Kitchen Utensil Set, Accents Range, Kitchen Tool Set, Stainless Steel, Red, 5-Piece', 96, '5 PIECES', 157, 'RED', 102, 'MRSE102102', '73231000', '5011832038074', 1, '<p>ACCENTS 5 PCS TOOL SET&nbsp;</p><h3 style=\"padding: 0px 0px 4px; margin: 0.75em 0px 0.375em -1px; text-rendering: optimizelegibility; font-size: 1.23em; line-height: 24px; color: rgb(51, 51, 51); clear: left; font-family: &quot;Amazon Ember&quot;, Arial, sans-serif;\">Product Description</h3><p style=\"padding: 0px; margin: 0em 0px 1em 1em; color: rgb(51, 51, 51); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: small; letter-spacing: normal;\">Equip yourself to meet all manner of food preparation with an accents five piece tool set. Comprising a turner, slotted spoon, solid spoon, ladle and a masher, this set offers an utmost in functionality as well as an elegant design in your kitchen. Constructed from high grade stainless steel, each individual item is built with longevity in mind. Ergonomically designed oval tube handles provide comfort and control during use whilst its colour-match coating looks great in any style of kitchen. Complete with an included steel wire stand for ease of accessibility, this accents five piece tool set handles every eventuality with effortless style and ease.</p><h3 style=\"padding: 0px 0px 4px; margin: 0.75em 0px 0.375em -1px; text-rendering: optimizelegibility; font-size: 1.23em; line-height: 24px; color: rgb(51, 51, 51); clear: left; font-family: &quot;Amazon Ember&quot;, Arial, sans-serif;\">Box Contains</h3><p style=\"padding: 0px; margin: 0em 0px 1em 1em; color: rgb(51, 51, 51); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: small; letter-spacing: normal;\"></p><ul style=\"margin: 1.12em 0px 1.12em 20px; padding: 0px; font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: small;\"><li style=\"list-style-type: disc; overflow-wrap: break-word; margin: 0px 0px 0px 20px;\">1 x Slotted spoon</li><li style=\"list-style-type: disc; overflow-wrap: break-word; margin: 0px 0px 0px 20px;\">1 x Solid spoon</li><li style=\"list-style-type: disc; overflow-wrap: break-word; margin: 0px 0px 0px 20px;\">1 x Slotted turner</li><li style=\"list-style-type: disc; overflow-wrap: break-word; margin: 0px 0px 0px 20px;\">1 x Ladle</li><li style=\"list-style-type: disc; overflow-wrap: break-word; margin: 0px 0px 0px 20px;\">1 x Masher</li><li style=\"list-style-type: disc; overflow-wrap: break-word; margin: 0px 0px 0px 20px;\">1 x Steel wire stand</li></ul>', 661, '/media/images/products/149/prod_20122020_5fde967ad818e.jpg', 199, 229, 0, 339, 'SEA', 0, 35, 3, 20, NULL, 'ACCENTS 5 PCS TOOL SET - RED - 5 PIECES Morphy Richards Kitchen Utensil Set, Accents Range, Kitchen Tool Set, Stainless Steel, Red, 5-Piece 5 PIECES RED MRSE102102 SEA  ACCENTS 5 PCS TOOL SET&nbsp;  Product Description  Equip yourself to meet all manner of food preparation with an accents five piece tool set. Comprising a turner, slotted spoon, solid spoon, ladle and a masher, this set offers an utmost in functionality as well as an elegant design in your kitchen. Constructed from high grade stainless steel, each individual item is built with longevity in mind. Ergonomically designed oval tube handles provide comfort and control during use whilst its colour-match coating looks great in any style of kitchen. Complete with an included steel wire stand for ease of accessibility, this accents five piece tool set handles every eventuality with effortless style and ease.  Box Contains     1 x Slotted spoon  1 x Solid spoon  1 x Slotted turner  1 x Ladle  1 x Masher  1 x Steel wire stand  ', NULL, 1, NULL, NULL, NULL, NULL, 1, '2020-12-20 06:10:34', 1, '2020-12-20 06:11:23', NULL);
