(417, 187, 103, '101103126103', 'JOSEPH JOSEPH UTENSIL SET DOORSTORE  - MULTI - 4 PIECE', '4 Piece DoorStore Utensil Set', 135, '4 PIECE', 153, 'MULTI', 103, 'JJUT109103', '39241000', '5028420101782', 1, '<p>JOSEPH JOSEPH UTENSIL SET&nbsp;</p><p><span style=\"color: rgb(78, 78, 78); font-family: Montserrat, sans-serif; font-size: 17.5px; letter-spacing: normal;\">The Doorstore utensil set from Joseph Joseph is a handy piece of kitchenware, ideal for those with limited surface space.&nbsp; &nbsp;Affix to the back of your cupboard door with the easy to apply adhesive mounts and you\'re good to go!&nbsp; Each utensil hooks neatly onto the rack for an organised, space saving storage solution.&nbsp; &nbsp;Included in the set are 4 silicone utensils, perfect for everyday use.&nbsp;</span></p><p><span style=\"color: rgb(78, 78, 78); font-family: Montserrat, sans-serif; font-size: 17.5px; letter-spacing: normal;\"><br></span></p><ul style=\"margin-bottom: 2.5rem; font-family: Montserrat, sans-serif; font-size: 17.5px;\"><li style=\"margin-top: 0px; margin-bottom: 1rem;\">Silicone tool heads heat-resistant up to 270°C/520°F</li><li style=\"margin-top: 0px; margin-bottom: 1rem;\">Nylon handles heat-resistant up to 200˚C/392˚F</li></ul>', 662, '/media/images/products/187/prod_20122020_5fde9e3e1eb80.jpg', 159, 179, 0, 339, 'SEA', 0, 25, 3, 20, NULL, 'JOSEPH JOSEPH UTENSIL SET DOORSTORE  - MULTI - 4 PIECE 4 Piece DoorStore Utensil Set 4 PIECE MULTI JJUT109103 SEA  JOSEPH JOSEPH UTENSIL SET&nbsp;   The Doorstore utensil set from Joseph Joseph is a handy piece of kitchenware, ideal for those with limited surface space.&nbsp; &nbsp;Affix to the back of your cupboard door with the easy to apply adhesive mounts and you\'re good to go!&nbsp; Each utensil hooks neatly onto the rack for an organised, space saving storage solution.&nbsp; &nbsp;Included in the set are 4 silicone utensils, perfect for everyday use.&nbsp;         Silicone tool heads heat-resistant up to 270°C/520°F  Nylon handles heat-resistant up to 200˚C/392˚F  ', NULL, 1, NULL, NULL, NULL, NULL, 1, '2020-12-20 06:43:42', 1, '2020-12-22 01:53:06', NULL),
(418, 207, 101, '101103129101', 'BODUM TRIBUTE SET - GREEN -  K11352-467UK', 'SET 3 ­ UK Cafetière 8 cup/1.0l, Travel Mug and Blade Grinder, Green', 136, 'MULTI', 196, 'GREEN', 101, 'BOTS101101', '39241000', '699965450618', 1, '<p style=\"margin-block: 0px; speak: none; -webkit-font-smoothing: antialiased; margin-right: 0px; margin-bottom: 6px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: GraphikBodum-Regular, Helvetica, Arial, sans-serif; font-size: 11px; vertical-align: baseline;\"><span style=\"margin-block: 0px; speak: none; -webkit-font-smoothing: antialiased; font-weight: 600; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline;\">Ideal for coffee lovers</span>, this stylish BODUM coffee set means you can enjoy perfectly brewed coffee everyday, whether you’re relaxing at home or on-the-go with a busy schedule. Coffee connoisseurs agree that freshly ground coffee reigns supreme.</p><p style=\"margin-block: 0px; speak: none; -webkit-font-smoothing: antialiased; margin-right: 0px; margin-bottom: 6px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: GraphikBodum-Regular, Helvetica, Arial, sans-serif; font-size: 11px; vertical-align: baseline;\">So the first step to delicious coffee is the&nbsp;<span style=\"margin-block: 0px; speak: none; -webkit-font-smoothing: antialiased; font-weight: 600; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline;\">BISTRO electric coffee grinder</span>. Transform your beans from coarse to fine at the touch of a button. You have ultimate control to get your beans exactly as you like them, with a choice between pulse action and continuous grind, and a transparent lid for quality control.</p><p style=\"margin-block: 0px; speak: none; -webkit-font-smoothing: antialiased; margin-right: 0px; margin-bottom: 6px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: GraphikBodum-Regular, Helvetica, Arial, sans-serif; font-size: 11px; vertical-align: baseline;\"><span style=\"margin-block: 0px; speak: none; -webkit-font-smoothing: antialiased; font-weight: 600; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline;\">French press coffee makers</span>&nbsp;are renowned for making full-bodied, aromatic coffee. Simply add freshly ground beans and hot water, wait four minutes, and press the plunger. Not only will your reinvigorating cup of joe taste amazing, it’s also great for the environment – make taste, not waste is BODUM’s motto, after all. This generous stainless steel coffee maker has a 1-litre capacity, so it’s ideal for sharing with family and friends.</p><p style=\"margin-block: 0px; speak: none; -webkit-font-smoothing: antialiased; margin-right: 0px; margin-bottom: 6px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: GraphikBodum-Regular, Helvetica, Arial, sans-serif; font-size: 11px; vertical-align: baseline;\">Perfect for today’s busy lifestyle, the&nbsp;<span style=\"margin-block: 0px; speak: none; -webkit-font-smoothing: antialiased; font-weight: 600; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline;\">double wall travel mug</span>&nbsp;means you can take your perfectly brewed cuppa with you, wherever you go. Its double-wall design ensures coffee stays hot for several hours, while the silicone band is safe and comfortable to hold. Just make sure you keep it upright for safety reasons.</p><h2 style=\"margin-block: 0px; speak: none; -webkit-font-smoothing: antialiased; font-family: GraphikBodum-Regular, Helvetica, Arial, sans-serif; line-height: inherit; color: rgb(0, 0, 0); margin: 30px 0px 9px; font-size: 11px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; vertical-align: baseline; letter-spacing: 0.5px;\">The Set contains:</h2><ul style=\"margin-block: 0px; speak: none; -webkit-font-smoothing: antialiased; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 0px 20px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 18px; font-family: GraphikBodum-Regular, Helvetica, Arial, sans-serif; font-size: 11px; vertical-align: baseline; list-style-position: inside; list-style-image: initial; padding-inline-start: 0px; letter-spacing: 0.5px;\"><li style=\"margin-block: 0px; speak: none; -webkit-font-smoothing: antialiased; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline;\">Coffee Grinder (stainless steel, plastic and rubber)</li><li style=\"margin-block: 0px; speak: none; -webkit-font-smoothing: antialiased; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline;\">1l Coffee Maker (stainless steel, plastic and silicone)</li><li style=\"margin-block: 0px; speak: none; -webkit-font-smoothing: antialiased; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline;\">0.35l Travel Mug (plastic, rubber and silicone)</li></ul>', 664, '/media/images/prod