 Stainless Steel, which stands for a high quality of the item and the Black dial gives the watch that unique look. The features of the watch include (among others) a date function. In regards to the water resistance, the watch has got a resistancy up to 30 metres. It means it can be worn in scenarios where it is likely to be splashed but not immersed in water. It can be worn while washing your hands and will be fine in rain     ', NULL, 1, NULL, NULL, NULL, NULL, 1, '2020-12-31 00:39:14', 1, '2020-12-31 00:39:14', NULL),
