nt when fitted with sapphire crystal. Sapphire crystal measures very high at 9 on the Mohs scale (hardness), a rating measure of the relative hardness of various materials.\" class=\"prod_att_bub\" style=\"content: &quot;&quot;;\"></span></td><td style=\"padding: 0px; width: 129px;\"><span style=\"font-weight: 600;\">Bracelet Type</span></td><td style=\"padding: 0px; width: 129px;\">Stainless Steel Bracelet<span id=\"strapbracelet_type\"></span></td></tr><tr><td style=\"padding: 0px; width: 130px;\"><span style=\"font-weight: 600;\">Strap Colour</span></td><td style=\"padding: 0px; width: 129px;\">Rose Gold<span id=\"strapbracelet_colour\"></span></td><td style=\"padding: 0px; width: 129px;\"><span style=\"font-weight: 600;\">Clasp Type</span></td><td style=\"padding: 0px; position: relative; width: 129px;\">Push Button Deployment Clasp&nbsp;<span id=\"clasp_type\" data-title=\"A push deployment clasp, also called a deployment buckle, is a deployment clasp with an invisible double locking clasp is a metal mechanism designed to fasten a watch band with a fitted look. This is easy to use and highly secure.\" class=\"prod_att_bub\" style=\"content: &quot;&quot;;\"></span></td></tr><tr><td style=\"padding: 0px; width: 130px;\"><span style=\"font-weight: 600;\">Date</span></td><td style=\"padding: 0px; width: 129px;\">Yes<span id=\"date\"></span></td><td style=\"padding: 0px; width: 129px;\"><span style=\"font-weight: 600;\">Watch Display</span></td><td style=\"padding: 0px; width: 129px;\">Analogue&nbsp;<span id=\"watch_display\" data-title=\"An analogue watch is a watch whose display is not digital but rather analogue with a traditional clock face. An analogue watch has hands to show the time.\" class=\"prod_att_bub\" style=\"content: &quot;&quot;;\"></span></td></tr><tr><td style=\"padding: 0px; width: 130px;\"><span style=\"font-weight: 600;\">Watch Movement</span></td><td style=\"padding: 0px; width: 129px;\">Quartz&nbsp;<span id=\"watch_movement\" data-title=\"Accurate and easy to maintain, quartz movement is powered by a battery. An electrical current is sent to a quartz crystal, creating vibrations, which power the watch\'s hands. Most quartz watches will not need a new battery for up to 5 years, thus requiring minimum maintenance.\" class=\"prod_att_bub\" style=\"content: &quot;&quot;;\"></span></td><td style=\"padding: 0px; width: 129px;\"><span style=\"font-weight: 600;\">Water Resistance</span></td><td style=\"padding: 0px; width: 129px;\">100 metres&nbsp;<span id=\"water_resistance\" data-title=\"Suitable for swimming , snorkelling, water sports. This watch should not be used for diving.\" class=\"prod_att_bub\" style=\"content: &quot;&quot;;\"></span></td></tr><tr><td style=\"padding: 0px; width: 130px;\"><span style=\"font-weight: 600;\">Packaging</span></td><td style=\"padding: 0px; width: 129px;\">Official Tissot Packaging<span id=\"packaging\"></span></td><td style=\"padding: 0px; width: 129px;\"><span style=\"font-weight: 600;\">Warranty</span></td><td style=\"padding: 0px; width: 129px;\">2 Year Tissot Warranty<span id=\"warranty\"></span></td></tr></tbody></table></div></div>', 854, '/media/images/products/261/prod_31122020_5feccf0e42a59.jpg', 1379, 1499, 0, 339, 'AIR', 0, 10, 3, 20, NULL, 'TISSOT WATCH - CAD COULEUR CREME - ONE SIZE  ONE SIZE CAD COULEUR CREME TSWA101105 AIR  TISSOT WATCH&nbsp;   This classically designed watch is perfect for everyday wear and every occasion. Beautifully crafted in stainless steel with a dazzling rose gold plating, the watch features an elegant and stylish rose gold dial complete with date detail at 6 o\'clock. The embodiment of the Tissot aesthetic; luxury, quality and classic style, the watch is a welcome addition to your collection.  - Case Width: 25mm - Watch Movement: Quartz - Water Resistant: 100 metres     SPECIFICATION        Brand   Tissot     Model Variant   PR 100       Brand Code   T101.010.33.451.00     Our code   2342365       Gender   Ladies&nbsp;     Dial Colou